Throwback to when I got to hang out with a pile (Cluster? Gaggle? Puddle?) of baby sloths when I was in Costa Rica (one of my favourite countries... and consistently rated as one of the worlds happiest)! These are baby coloepus sloths - also known as the two-toed sloth. Yes. I know all the sloth species by their proper names. Yes. I can do a sloth mating call (made by the female Bradypus AKA the three toed sloth). And yes. If you’re wondering, this was the happiest day of my life. My wedding was great and all but this was truly a life highlight! 🥰 Tag a friend who loves sloths as much as me. 
